import React from "react";
import axios from "axios";

import "./Form.css";

const saveTodo = async (event) => {
  event.preventDefault();
  console.log("Clicked~");
  await axios
    .post("https://google.com", {
      name: "Create by fontend!!",
    })
    .then(
      (res) => {
        console.log(res);
      },
      (err) => {
        console.log(err);
      }
    );
};

function Form() {
  return (
    <form className="form">
      <label className="label">What to do?</label>
      <input className="input" type="text"></input>
      <button className="button" onClick={saveTodo}>
        Add Todo
      </button>
    </form>
  );
}

export default Form;
